import React from 'react';
import { 
    IonBackButton,
    IonButton,
    IonButtons,
    IonIcon
} from '@ionic/react';
import { returnUpBack } from 'ionicons/icons';


const BackBtn: React.FC = () => (
    <IonButtons slot="end">
        <IonButton>
            <IonBackButton>
                <IonIcon slot="icon-only" icon={returnUpBack}></IonIcon>
            </IonBackButton>
        </IonButton>
    </IonButtons>
)

export default BackBtn;
